import React, { Component } from "react";
//import Router from 'react-router-dom';

class Register extends Component {

    register(){
        console.warn("state", this.state);
        fetch('http://localhost:8000/register', {
            method: "POST",
            headers: {
                "Accept" : "application/json",
                "Content-Type": "application/json"
            },
            body:JSON.stringify(this.state) 
        }).then((result)=>{
            result.json().then((response)=>{
                console.log(response);
                localStorage.setItem("login", JSON.stringify(response))
            })
        })
    }
    render() {
        return (
            <div>
                <br />
                <input type="text" placeholder="" onChange={(evt) => {this.setState({fullName: evt.target.value})}} /> <br /> <br /> 
                <input type="text" onChange={(evt) => { this.setState({ email: evt.target.value }) }} /> <br /> <br />
                <input type="text" onChange={(evt) => { this.setState({ password: evt.target.value }) }} /> <br /> <br />
                <input type="text" onChange={(evt) => { this.setState({ c_password: evt.target.value }) }} /> <br /> <br /> 
                <button onClick={() => this.register()} > Register </button>
            </div>
        )
    }
}

export default Register;
